import React, { Component } from 'react';
import classNames from 'classnames';

export default class Form extends Component {


    render(){
        return (
            <div class="download-wrapper">
                <h3 class="h3">Be the first to try Hood Food Guide</h3>
                <p class="download-paragraph">Join our private waitlist in just one click.</p>

                <form method="post" action="https://mc.us10.list-manage.com/subscribe/post" class="app-store-wrapper">
                    <input type="hidden" name="u" value="996c443c67aecf27290a79302"/>
                    <input type="hidden" name="id" value="413478499d"/>
                    <input type="email" required="" class="prelist-email" id="email" name="email" placeholder="Enter your email..."/>

                    <button type="submit" class="prelist-submit">Subscribe</button>
                </form>
            </div>
        );
    }
}
